import React from 'react';
import { YMaps, Map, Placemark } from 'yandex-maps-react';

const MapComponent = () => {
  return (
    <YMaps>
      <div>
        <h1>Yandex Map with Another Library</h1>
        <Map defaultState={{ center: [55.751244, 37.618423], zoom: 10 }} width="100%" height="400px">
          <Placemark geometry={[55.751244, 37.618423]} properties={{ iconCaption: 'Moscow' }} />
        </Map>
      </div>
    </YMaps>
  );
};

export default MapComponent;
